import React from "react";
import { connect } from "react-redux";
const ShowTodo = props => {
  console.log(props.todos);
  console.log(" __" + props.filter);
  return null;
};

const mapStateToProps = state => {
  return state;
};

export default connect(mapStateToProps)(ShowTodo);
